import { Link } from "react-router-dom";
import { Head } from "../Head";
import "../../styles/style.css";

export const Landing = () => {
  return (
    <div>
      <h1>Bem-vindo</h1>
      <Link to="/head">
        <button>Fazer consulta</button>
      </Link>
      <Link to="/patients">
        <a href="#">Consultar Pacientes</a>
      </Link>
    </div>
  );
};
